import React, { Component } from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Navbar, NavItem, Nav } from 'reactstrap'


class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      //state
    }
  }

  render() {
    return (
      <div className="App">
        <header className="App-header">
          <h1 className="text-center">
            군대이야기
          </h1>
        </header>

        <div className="navBar mt-5">
          <Navbar>
            <div className="mx-auto">
              <Nav>
                <NavItem ><a href="#1">나의 일기</a>
                </NavItem>
                <NavItem className="ml-5"><a href="#2">남의 일기</a></NavItem>
              </Nav>
            </div>
          </Navbar>
        </div>

        <div className="diary-control">

          <div className="text-center">
            <div class="md-form mb-4 pink-textarea active-pink-textarea">
            <textarea placeholder="Enter something funny." id="text" name="text" rows="4" 
            className="overflow: hidden; word-wrap: break-word; resize: none; height: 160px;"></textarea> 
            </div>
          </div>
        </div>

      </div>

    );
  }
}

export default App;
